import React from 'react';

const App = () => {
  const imageUrl = 'https://images-bucket-yutk.s3.eu-north-1.amazonaws.com/gettyimages-74847953-612x612.jpg';

  return (
    <div>
      <h1>Displaying an Image from S3 in React</h1>
      <img src={imageUrl} alt="S3 Image" />
    </div>
  );
};

export default App;
